import React, { useEffect, useState } from "react";
import "./App.css";
import axios from "axios";
import pokemonLogo from "./images/pokemon.png";
import {
  Button,
  Card,
  CardBody,
  CardGroup,
  CardImg,
  CardSubtitle,
  CardText,
  CardTitle,
  Col,
  Container,
  Row,
} from "reactstrap";
function App() {
  const [pokemonList, setPokemonList] = useState();
  const [pokemonCount, setPokemonCount] = useState();
  useEffect(() => {
    axios.get("https://pokeapi.co/api/v2/pokemon/").then((res) => {
      console.info(res, res);
      setPokemonList(res.results);
      setPokemonCount(res.count);
    });
  }, []);
  return (
    <div className="App">
      <nav className="navbar navbar-expand-lg navbar-light bg-light">
        <Row className="d-flex w-100">
          <Col sm="4">
            <Row className="row-no-gutters">
              <Col sm="3">
                <img src={pokemonLogo} width={50} height={50} />
              </Col>
              <Col sm="6" className="pt-2 justify-content-left">
                <h4 className="d-flex">Pokedex</h4>
              </Col>
            </Row>
          </Col>
        </Row>
      </nav>
      <Container>
        <CardGroup>
          {pokemonList.map((data) => (
            <Card>
              <CardImg alt="Card image cap" src={data.url} top width="100%" />
              <CardBody>
                <CardTitle tag="h5">{data.name}</CardTitle>
              </CardBody>
            </Card>
          ))}
        </CardGroup>
      </Container>
    </div>
  );
}

export default App;
